import React from 'react';
import styled from 'styled-components';
import { colors } from '../styles';

const Span = styled.span`
  display: inline-block;
  padding: 3px;
  margin: 5px 0;
  font-size: 14px;
  background-color: rgba(${colors.yellow});
`;

function Date({ date }) {
  return <Span>{date}</Span>;
}

export default Date;
